pedia.org\/wiki\/1605_%D0%B3%D0%BE%D0%B4\" title=\"1605 \u0433\u043e\u0434\">1605<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8%D1%82%D0%B2%D0%B0_%D0%BF%D1%80%D0%B8_%D0%9A%D0%B8%D1%80%D1%85%D0%B3%D0%BE%D0%BB%D1%8C%D0%BC%D0%B5\" title=\"\u0411\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u041a\u0438\u0440\u0445\u0433\u043e\u043b\u044c\u043c\u0435\">\u0411\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u041a\u0438\u0440\u0445\u0433\u043e\u043b\u044c\u043c\u0435<\/a>&#160;\u2014 \u0440\u0430\u0437\u0433\u0440\u043e\u043c \u0448\u0432\u0435\u0434\u0441\u043a\u0438\u0445 \u0432\u043e\u0439\u0441\u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D0%BB_IX_(%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D1%8C_%D0%A8%D0%B2%D0%B5%D1%86%D0%B8%D0%B8)\" title=\"\u041a\u0430\u0440\u043b IX (\u043a\u043e\u0440\u043e\u043b\u044c \u0428\u0432\u0435\u0446\u0438\u0438)\">\u041a\u0430\u0440\u043b\u0430 IX<\/a> \u043b\u0438\u0442\u043e\u0432\u0441\u043a\u0438\u043c\u0438 \u0432\u043e\u0439\u0441\u043a\u0430\u043c\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%BE%D0%B4%D0%BA%D0%B5%D0%B2%D0%B8%D1%87,_%D0%AF%D0%BD_%D0%9A%D0%B0%D1%80%D0%BE%D0%BB%D1%8C\" title=\"\u0425\u043e\u0434\u043a\u0435\u0432\u0438\u0447, \u042f\u043d \u041a\u0430\u0440\u043e\u043b\u044c\">\u0425\u043e\u0434\u043a\u0435\u0432\u0438\u0447\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1672_%D0%B3%D0%BE%D0%B4\" title=\"1672 \u0433\u043e\u0434\">1672<\/a>&#160;\u2014 \u041a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u043a\u0430\u044f \u0410\u0444\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0430\u044f \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u044f (\u0410\u043d\u0433\u043b\u0438\u044f) \u043f\u043e\u043b\u0443\u0447\u0438\u043b\u0430 \u043c\u043e\u043d\u043e\u043f\u043e\u043b\u044c\u043d\u043e\u0435 \u043f\u0440\u0430\u0432\u043e \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B0%D0%B1%D0%BE%D1%82%D0%BE%D1%80%D0%B3%D0%BE%D0%B2%D0%BB%D1%8F\" title=\"\u0420\u0430\u0431\u043e\u0442\u043e\u0440\u0433\u043e\u0432\u043b\u044f\">\u0442\u043e\u0440\u0433\u043e\u0432\u043b\u044e \u0440\u0430\u0431\u0430\u043c\u0438<\/a> \u0438\u0437 \u0410\u0444\u0440\u0438\u043a\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1781_%D0%B3%D0%BE%D0%B4\" title=\"1781 \u0433\u043e\u0434\">1781<\/a>&#160;\u2014 \u0412 \u0441\u043e\u0441\u0442\u0430\u0432\u0435 \u0420\u043e\u0441\u0441\u0438\u0438 \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u043e \u041a\u0438\u0435\u0432\u0441\u043a\u043e\u0435, \u0427\u0435\u0440\u043d\u0438\u0433\u043e\u0432\u0441\u043a\u043e\u0435, \u041d\u043e\u0432\u0433\u043e\u0440\u043e\u0434-\u0421\u0435\u0432\u0435\u0440\u0441\u043a\u043e\u0435 \u043d\u0430\u043c\u0435\u0441\u0442\u043d\u0438\u0447\u0435\u0441\u0442\u0432\u0430.<\/li><\/ul><h3><a href=\"https:\/\/ru.wikipedia.org\/wiki\/XIX_%D0%B2%D0%B5%D0%BA\" title=\"XIX \u0432\u0435\u043a\">XIX \u0432\u0435\u043a<\/a> <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1810_%D0%B3%D0%BE%D0%B4\" title=\"1810 \u0433\u043e\u0434\">1810<\/a>&#160;\u2014 \u0441\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u043c\u0435\u0436\u0434\u0443 \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0438\u043c\u0438 \u0432\u043e\u0439\u0441\u043a\u0430\u043c\u0438, \u043f\u043e\u0434 \u043d\u0430\u0447\u0430\u043b\u044c\u0441\u0442\u0432\u043e\u043c \u043c\u0430\u0440\u0448\u0430\u043b\u0430 \u041c\u0430\u0441\u0441\u0435\u043d\u044b \u0438 \u0430\u043d\u0433\u043b\u043e-\u043f\u043e\u0440\u0442\u0443\u0433\u0430\u043b\u044c\u0441\u043a\u043e\u044e \u0430\u0440\u043c\u0438\u0435\u0439, \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u043a\u043e\u043c\u0430\u043d\u0434\u043e\u0432\u0430\u043b \u0412\u0435\u043b\u043b\u0438\u043d\u0433\u0442\u043e\u043d \u0431\u043b\u0438\u0437 \u043c\u043e\u043d\u0430\u0441\u0442\u044b\u0440\u044f \u0411\u0443\u0437\u0430\u043a\u043e .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1811_%D0%B3%D0%BE%D0%B4\" title=