u0448\u0438\u0444\u0440\u043e\u0432\u043a\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D0%B7%D0%B5%D1%82%D1%82%D1%81%D0%BA%D0%B8%D0%B9_%D0%BA%D0%B0%D0%BC%D0%B5%D0%BD%D1%8C\" title=\"\u0420\u043e\u0437\u0435\u0442\u0442\u0441\u043a\u0438\u0439 \u043a\u0430\u043c\u0435\u043d\u044c\">\u0420\u043e\u0437\u0435\u0442\u0441\u043a\u043e\u0433\u043e \u043a\u0430\u043c\u043d\u044f<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1825_%D0%B3%D0%BE%D0%B4\" title=\"1825 \u0433\u043e\u0434\">1825<\/a>&#160;\u2014 \u0412 \u0410\u043d\u0433\u043b\u0438\u0438 \u043d\u0430\u0447\u0430\u043b\u043e\u0441\u044c \u0434\u0432\u0438\u0436\u0435\u043d\u0438\u0435 \u043f\u043e \u043f\u0435\u0440\u0432\u043e\u0439 \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%96%D0%B5%D0%BB%D0%B5%D0%B7%D0%BD%D0%B0%D1%8F_%D0%B4%D0%BE%D1%80%D0%BE%D0%B3%D0%B0\" class=\"mw-redirect\" title=\"\u0416\u0435\u043b\u0435\u0437\u043d\u0430\u044f \u0434\u043e\u0440\u043e\u0433\u0430\">\u0436\u0435\u043b\u0435\u0437\u043d\u043e\u0439 \u0434\u043e\u0440\u043e\u0433\u0435<\/a>. \u041f\u0430\u0440\u043e\u0432\u043e\u0437, \u0441\u043a\u043e\u043d\u0441\u0442\u0440\u0443\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D0%B5%D1%84%D0%B5%D0%BD%D1%81%D0%BE%D0%BD,_%D0%94%D0%B6%D0%BE%D1%80%D0%B4%D0%B6\" title=\"\u0421\u0442\u0435\u0444\u0435\u043d\u0441\u043e\u043d, \u0414\u0436\u043e\u0440\u0434\u0436\">\u0414\u0436\u043e\u0440\u0434\u0436\u0435\u043c \u0421\u0442\u0435\u0444\u0435\u043d\u0441\u043e\u043d\u043e\u043c<\/a>, \u043f\u0440\u043e\u0432\u0451\u0437 \u043f\u043e\u0435\u0437\u0434 \u0441 450 \u043f\u0430\u0441\u0441\u0430\u0436\u0438\u0440\u0430\u043c\u0438 \u0438\u0437 \u0414\u0430\u0440\u043b\u0438\u043d\u0433\u0442\u043e\u043d\u0430 \u0432 \u0421\u0442\u043e\u043a\u0442\u043e\u043d \u0441\u043e \u0441\u043a\u043e\u0440\u043e\u0441\u0442\u044c\u044e 24 \u043a\u043c\/\u0447.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1829_%D0%B3%D0%BE%D0%B4\" title=\"1829 \u0433\u043e\u0434\">1829<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D1%80%D0%BE%D1%82,_%D0%98%D0%BE%D0%B3%D0%B0%D0%BD%D0%BD_%D0%A4%D1%80%D0%B8%D0%B4%D1%80%D0%B8%D1%85\" title=\"\u041f\u0430\u0440\u0440\u043e\u0442, \u0418\u043e\u0433\u0430\u043d\u043d \u0424\u0440\u0438\u0434\u0440\u0438\u0445\">\u0418\u043e\u0433\u0430\u043d\u043d \u0424\u0440\u0438\u0434\u0440\u0438\u0445 \u041f\u0430\u0440\u0440\u043e\u0442<\/a> \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0441\u043e\u0432\u0435\u0440\u0448\u0438\u043b \u0432\u043e\u0441\u0445\u043e\u0436\u0434\u0435\u043d\u0438\u0435 \u043d\u0430 \u0411\u043e\u043b\u044c\u0448\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%80%D0%B0%D1%80%D0%B0%D1%82\" title=\"\u0410\u0440\u0430\u0440\u0430\u0442\">\u0410\u0440\u0430\u0440\u0430\u0442<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1854_%D0%B3%D0%BE%D0%B4\" title=\"1854 \u0433\u043e\u0434\">1854<\/a>&#160;\u2014 \u043f\u0430\u0440\u043e\u0445\u043e\u0434 \u00ab<a href=\"https:\/\/en.wikipedia.org\/wiki\/SS_Arctic\" class=\"extiw\" title=\"en:SS Arctic\">Arctic<\/a>\u00bb, \u0438\u0434\u044f \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D1%81%D0%BA%D0%B8%D0%B5_%D0%BE%D1%81%D1%82%D1%80%D0%BE%D0%B2%D0%B0\" title=\"\u0411\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u0438\u0435 \u043e\u0441\u0442\u0440\u043e\u0432\u0430\">\u0411\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u0438\u0445 \u043e\u0441\u0442\u0440\u043e\u0432\u043e\u0432<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%BE%D0%B2%D1%8B%D0%B9_%D0%A1%D0%B2%D0%B5%D1%82\" title=\"\u041d\u043e\u0432\u044b\u0439 \u0421\u0432\u0435\u0442\">\u041d\u043e\u0432\u044b\u0439 \u0421\u0432\u0435\u0442<\/a>, \u0441\u0442\u043e\u043b\u043a\u043d\u0443\u043b\u0441\u044f \u0441 \u043f\u0430\u0440\u043e\u0445\u043e\u0434\u043e\u043c \u00ab<a href=\"https:\/\/en.wikipedia.org\/wiki\/SS_Vesta\" class=\"extiw\" title=\"en:SS Vesta\">Vesta<\/a>\u00bb (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u044f<\/a>) \u0438 \u0437\u0430\u0442\u043e\u043d\u0443\u043b \u0443 \u043c\u044b\u0441\u0430 \u0420\u0435\u0439\u0441. \u041f\u043e\u0433\u0438\u0431\u043b\u0438 350 \u0447\u0435\u043b\u043e\u0432\u0435\u043a.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1863_%D0%B3%D0%BE%D0%B4\" title=\"1863 \u0433\u043e\u0434\">1863<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0435<\/a> \u043e\u0442\u043a\u0440\u044b\u0442 \u043f\u0435\u0440\u0432\u044b\u0439 \u0432 \u0420\u043e\u0441\u0441\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B5%D1%82%D1%81%D0%BA%D0%B8%D0%B9_%D1%81%D0%B0%D0%B4\" title=\"\u0414\u0435\u0442\u0441\u043a\u0438\u0439 \u0441\u0430\u0434\">\u0434\u0435\u0442\u0441\u043a\u0438\u0439 \u0441\u0430\u0434<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1885_%D0%B3%D0%BE%D0%B4\" title=\"1885 \u0433\u043e\u0434\">1885<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%B0%D1%80%D1%8C%D0%BA%D0%BE%D0%B2\" title=\"\u0425\u0430\u0440\u044c\u043a\u043e\u0432\">\u0425\u0430\u0440\u044c\u043a\u043e\u0432\u0435<\/a> \u043e\u0442\u043a\u0440\u044b\u0442 \u042e\u0436\u043d\u043e\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0438\u0439 \u0442\u0435\u0445\u043d\u043e\u043b\u043e\u0433\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442&#160;\u2014 \u043f\u0435\u0440\u0432\u043e\u0435 \u0432 \u0420\u043e\u0441\u0441\u0438\u0438 \u0432\u044b\u0441\u0448\u0435\u0435 \u0442\u0435\u0445\u043d\u0438\u0447\u0435\u0441\u043a\u043e\u0435 \u0443\u0447\u0435\u0431\u043d\u043e\u0435 \u0437\u0430\u0432\u0435\u0434\u0435\u043d\u0438\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1893_%D0%B3%D0%BE%D0%B4\" title=\"1893 \u0433\u043e\u0434\">1893<\/a>&#160;\u2014 \u0412 \u0414\u0436\u0435\u0440\u0441\u0438-\u0421\u0438\u0442\u0438 \u043d\u0430\u0447\u0430\u043b \u0438\u0437\u0434\u0430\u0432\u0430\u0442\u044c\u0441\u044f \u043f\u0435\u0440\u0432\u044b\u0439 \u0443\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u0438\u0439 \u043f\u0435\u0447\u0430\u0442\u043d\u044b\u0439 \u043e\u0440\u0433\u0430\u043d&#160;\u2014 \u0433\u0430\u0437\u0435\u0442\u0430 \u00ab\u0421\u0432\u043e\u0431\u043e\u0434\u0430\u00bb.<\/li><\/ul><h3><a href=\"https:\/\/ru.wikipedia.org\/wiki\/XX_%D0%B2%D0%B5%D0%BA\" title=\"XX \u0432\u0435\u043a\">XX \u0432\u0435\u043a<\/a> <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1905_%D0%B3%D0%BE%D0%B4\" title=\"1905 \u0433\u043e\u0434\">1905<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%B9%D0%BD%D1%88%D1%82%D0%B5%D0%B9%D0%BD,_%D0%90%D0%BB%D1%8C%D0%B1%D0%B5%D1%80%D1%82\" title=\"\u042d\u0439\u043d\u0448\u0442\u0435\u0439\u043d, \u0410\u043b\u044c\u0431\u0435\u0440\u0442\">\u0410\u043b\u044c\u0431\u0435\u0440\u0442 \u042d\u0439\u043d\u0448\u0442\u0435\u0439\u043d<\/a> \u043e\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0432\u0430\u043b \u0440\u0430\u0431\u043e\u0442\u0443 \u00ab\u0417\u0430\u0432\u0438\u0441\u0438\u0442 \u043b\u0438 \u0438\u043d\u0435\u0440\u0446\u0438\u044f \u0442\u0435\u043b\u0430 \u043e\u0442 \u0441\u043e\u0434\u0435\u0440\u0436\u0430\u0449\u0435\u0439\u0441\u044f \u0432 \u043d\u0451\u043c \u044d\u043d\u0435\u0440\u0433\u0438\u0438?\u00bb, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u043f\u0440\u0435\u0434\u043b\u0430\u0433\u0430\u043b\u043e\u0441\u044c \u0437\u043d\u0430\u043c